import React from 'react';

const AddUcenikForm = () => {
  const submitHandler = (e) => {
    e.preventDefault();
  };
  return (
    <form>
      <ul>
        <li>
          <input placeholder="Ime ucenika" type="text" />
        </li>
        <li>
          <input placeholder="Prezime ucenika" type="text" />
        </li>
      </ul>
    </form>
  );
};

export default AddUcenikForm;
